import Newsfooter from "./Newsfooter"
import Logo from "../Header/Header-menu-1/Logo.logo.png"


const Footer = () =>{
      return(
        <footer className="footer">
                <div className="container-footer">
                    <Logo/>
                    <Newsfooter/>
                </div>
        </footer>
      )
}



export default Footer;
